because it was first-party data.\n","- Because the dataset is public and open to the public, security, privacy, and accessibility were not an issue.\n","- R Studio was used to conduct the complete data analysis.\n","\n","# ASK PHASE\n","## How Do Annual Members And Casual Riders Use Cyclistic Bikes Differently?\n","The markerting team needs to design strategies aimed at converting casual riders into annual members which will be submitted to the cyclistic executive team that will decide whether to approve it. To do so, the marketing analyst team must first analyse the differences between annual members and casual riders, why casual riders would purchase a membership, and how digital media may alter their marketing methods.Hence, the goal of this analysis is to shed some light on how annual members and casual riders use cyclistic bikes differently depending on parameters derived from current data.\n","\n","\n","\n","# PREPARE PHASE\n","## Data Sources\n","From August 2022 to September 2021, a total of 12 datasets have been made available for each month. Each dataset contains information on every ride logged by Cyclistic customers. This publicly available data has been sanitised to remove rider personal details.\n","\n","## <span style=\"color:black\"> Dataset Limitation <a id=\"limitation\"></a>\n","​\n","Although the Dataset is ROCCC, there are still some null values in several information, i,e. start_station_name, start_station_id, end_station_name, and end_station_id. However, we can still locate them using the latitude and longitude coordinate of each start station and end station in start_lat, start_lng, end_lat and end_lng. Below is the example of data information on Dataset of September 2021. Nevertheless, total of null values can be considered small (less than 15%). \n","​\n","\n","\n","# <span style=\"color:#black\"> PROCESS PHASE <a id=\"process\"></a>\n","## Dataset Limitation "]},{"cell_type":"code","execution_count":1,"id":"51ce13d1","metadata":{"executio