ompare to Annual Riders. On daily basis, we can see that Casual Riders are oftenly ride on weekend, although there are also many of them who ride on weekdays.\n","\n","* Monthly Rides:On what months/seasons reach the peak riding for each User Type?\n"," It seems that Casual Riders relatively ride in the same trip duration, except when it comes to winter between November,December, January and February they will significantly spend less time on riding.\n","    \n","  \n","* Favorite Starting and ending Station: We provided Top 10 favorite Stations where the Casual and annual Riders used to start their ride. This gives us information on which Stations we could launch the marketing program as pilot project.\n","\n","## <span style=\"color:#black\"> Recommendation <a id=\"recommendation\"></a>\n","* A targeted marketing plan for Casual Riders could be made to focus more  riding-friendly seasons like Summer and the beginning of Fall.You should also partner with tour operators to offer a package that includes both an attraction pass and a bike pass, for example, to attract more casual riders.\n","* The number of annual members will go up if you offer a membership for weekday rentals.\n","* Ask the casual riders in a market survey if they would buy an annual package if there was a bike station near their home. If the answer is yes, think about putting new bike stations in key residential areas.\n","* More research should be conducted to determine why bikers do not ride during the winter season, and new products can be developed to assist with this.\n","\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":310.895367,"end_time":"2022-10-12T00:37:41.660335","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-10-12T00:32:30.764968","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}